import { connect } from "react-redux";
import { compose } from "redux";
import WithSpinner from "../with-spinner/with-spinner.component";
import collectionsOverviewComponenet from "./collections-overview.componenet";

const { createStructuredSelector } = require("reselect");
const { selectIsCollectionFetching } = require("../../redux/shop/shop.selector");

const mapStateToProps = createStructuredSelector({
    isLoading: !selectIsCollectionFetching
});

const CollectionOverviewContainer = compose(
    connect(mapStateToProps),WithSpinner)(collectionsOverviewComponenet);

export default CollectionOverviewContainer;
